//import 'bootstrap/dist/css/bootstrap.min.css';
//import MyModal from './components/Modal';

function App() {
  return (

<Router>
    <Routes>
      <Route path="/users/:userId" element={<UserDetailsAxios />} />
     {/* <Route path="/" element={<Layout><MyModal /></Layout>} />
